import React from "react";
import {BrowserRouter as Router, Routes, Link, Route} from "react-router-dom";
import Navbar from "./Components/Navbar";
import Home from "./Pages/Home";
function App() {
    return (
        <Router>
            <main>
                <Navbar/>
            </main>
            <Routes>
                <Route path="/" element={<Home/>} />
            </Routes>
        </Router>
    )
}

export default App;
